    .headerWrap{
        padding:0 30px;
        max-width: 1200px;
        height: 100%;
        margin:0 auto;
        display: flex;
        justify-content: space-between;
        align-items: center;

        .navWrap{
            display: flex;
            justify-content: space-between;
            align-items: center;

            .logoWrap{
                width:120px;

                .logo{
                    width:100%;
                    height: auto;
                }
            }
            
            .navInner{
                display: flex;
                padding-left:100px;

                .navItem{
                    position: relative;

                    ${mq.maxWidth('xl')`
                        display:none;
                    `}

                    .subMenuWrap{
                        width:200px;
                        position: absolute;
                        left:50%;
                        top:50px;
                        transform: translateX(-50%);
                        text-align: center;
                        overflow: hidden;
                        max-height:0;
                        z-index:20;
                        /* background-color: #0f05; */

                        .subMenuInner{
                            .subMenuItem{
                                &:first-child{
                                    padding-top:50px;
                                }
                                padding-bottom:15px;
                            }
                        }
                    }

                    .Mainlink{
                        font-size: 16px;
                        line-height: 1.6;
                        font-weight: 500;
                        padding:30px 15px;

                        &:hover{
                            color:#1F7A34;
                            font-weight:800;
                            border-bottom:3px solid #1F7A34;
                        }
                    }
                }
            }
        }

        .infoNavWrap{
            display: flex;

            .infoNavItem{

                &:last-child::before{
                    content:"Â·";
                    margin:0 5px;
                }
            }
        }
    }


`;

